INSERT INTO `ff_massmail_log` VALUES ('2013-05-08 19:40:22','Medlemsmøde for Hovedafdelingen','Hej alle medlemmer af Hovedafdelingen\r\n\r\nNu skal vi ha’ medlemsmøde – juhuu !\r\n\r\nVi mødes i Øko Caféen, \r\nNørrebrogade 32 (gården) \r\ntorsdag den 16. maj kl. 19-21.\r\n\r\nDer er kaffe og kage samt hy-y-y-y-y-geligt samvær.\r\nOg så er der ét punkt på dagsordenen:\r\n \r\nIdéer til det kommende halve år.\r\n\r\nSkal vi lave en bageworkshop?\r\nSkal vi ta’ på besøg hos nogen avlere?\r\nSkal vi ha’ flere varer til løssalg i butikken?\r\nSkal vi lave en aften med fællesspisning?\r\nEr der noget, vi skal forbedre?\r\nEr der noget, vi kan undvære?\r\nEr der nogen, der vil være mere aktive?\r\nEr der nogen, der vil med i en arbejdsgruppe?\r\n \r\nVi snakker ustruktureret, kærligt, respektfuld og konstruktivt\r\nmed lidt styring, når det er nødvendigt.\r\n \r\nMødet er besluttende for vores afdeling.\r\nVenlig hilsen Hovedafdelingen',1,1,0,'',1,231);
/*!40000 ALTER TABLE `ff_massmail_log` ENABLE KEYS */;
UNLOCK TABLES;

